import React from "react";


function card(){
    return (
        <>
        <div className="cards">
            <div className="card">
                <img src={imgsrc} alt="my pic" className="card_img" />
                <div className="card_info">
                    <span className="card_category">{cardname}</span>
                    <h3 className="card_title">{title}</h3>
                    <a href={link} target="_blank">
                        <button>Watch Now</button>
                    </a>
                </div>
            </div>
        </div>
    </>
    )
}
export default card;
